/*Table structure for table `hr_adjust_salary` */

DROP TABLE IF EXISTS `hr_adjust_salary`;

CREATE TABLE `hr_adjust_salary` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '调薪编号',
  `employee_id` bigint(20) DEFAULT NULL COMMENT '员工编号',
  `as_date` date DEFAULT NULL COMMENT '调薪日期',
  `before_salary` int(11) DEFAULT NULL COMMENT '调前薪资',
  `after_salary` int(11) DEFAULT NULL COMMENT '调后薪资',
  `reason` varchar(255) DEFAULT NULL COMMENT '调薪原因',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `pid` (`employee_id`),
  CONSTRAINT `adjustsalary_ibfk_1` FOREIGN KEY (`employee_id`) REFERENCES `hr_employee` (`employee_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='员工调薪表';

/*Data for the table `hr_adjust_salary` */

/*Table structure for table `hr_attendance` */

DROP TABLE IF EXISTS `hr_attendance`;

CREATE TABLE `hr_attendance` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '员工考勤编号',
  `employee_id` bigint(20) DEFAULT NULL COMMENT '员工编号',
  `mor_start_time` time DEFAULT NULL COMMENT '上午上班时间',
  `mor_end_time` time DEFAULT NULL COMMENT '上午下班时间',
  `aft_start_time` time DEFAULT NULL COMMENT '下午上班时间',
  `aft_end_time` time DEFAULT NULL COMMENT '下午下班时间',
  `attendance_date` date NOT NULL COMMENT '考勤日期',
  `attendance_status` char(10) DEFAULT NULL COMMENT '考勤状态',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改日期',
  `is_deleted` tinyint(4) unsigned DEFAULT '0' COMMENT '逻辑删除',
  PRIMARY KEY (`id`) USING BTREE
