/*Table structure for table `hr_emp_salary` */

DROP TABLE IF EXISTS `hr_emp_salary`;

CREATE TABLE `hr_emp_salary` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '员工薪资编号',
  `employee_id` bigint(20) DEFAULT NULL COMMENT '员工编号',
  `salary_id` bigint(20) DEFAULT NULL COMMENT '薪资编号',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `employee_id` (`employee_id`),
  KEY `empsalary_ibfk_2` (`salary_id`),
  CONSTRAINT `empsalary_ibfk_1` FOREIGN KEY (`employee_id`) REFERENCES `hr_employee` (`employee_id`),
  CONSTRAINT `empsalary_ibfk_2` FOREIGN KEY (`salary_id`) REFERENCES `hr_salary` (`salary_id`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='员工薪资表';

