/*Table structure for table `hr_employee` */

DROP TABLE IF EXISTS `hr_employee`;

CREATE TABLE `hr_employee` (
  `employee_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '员工编号',
  `name` varchar(10) DEFAULT NULL COMMENT '员工姓名',
  `gender` char(4) DEFAULT NULL COMMENT '性别',
  `birthday` date DEFAULT NULL COMMENT '出生日期',
  `id_card` char(18) DEFAULT NULL COMMENT '身份证号',
  `wedlock` char(4) DEFAULT NULL COMMENT '婚姻状况',
  `nation` varchar(20) DEFAULT NULL COMMENT '民族',
  `native_place` varchar(20) DEFAULT NULL COMMENT '籍贯',
  `politic` varchar(20) DEFAULT NULL COMMENT '政治面貌',
  `email` varchar(20) DEFAULT NULL COMMENT '邮箱',
  `phone` varchar(11) DEFAULT NULL COMMENT '电话号码',
  `address` varchar(64) DEFAULT NULL COMMENT '联系地址',
  `dept_id` bigint(20) DEFAULT NULL COMMENT '所属部门',
  `job_level_id` bigint(20) DEFAULT NULL COMMENT '职称ID',
  `post_id` bigint(20) DEFAULT NULL COMMENT '职位ID',
  `engage_form` varchar(8) DEFAULT NULL COMMENT '聘用形式',
  `tiptop_degree` char(10) DEFAULT NULL COMMENT '最高学历',
  `specialty` varchar(32) DEFAULT NULL COMMENT '所属专业',
  `school` varchar(32) DEFAULT NULL COMMENT '毕业院校',
  `begin_date` date DEFAULT NULL COMMENT '入职日期',
  `work_state` char(4) DEFAULT NULL COMMENT '在职状态',
  `work_id` char(8) DEFAULT NULL COMMENT '工号',
  `contract_term` double DEFAULT NULL COMMENT '合同期限',
  `conversion_time` date DEFAULT NULL COMMENT '转正日期',
  `not_work_date` date DEFAULT NULL COMMENT '离职日期',
  `begin_contract` date DEFAULT NULL COMMENT '合同起始日期',
  `end_contract` date DEFAULT NULL COMMENT '合同终止日期',
  `work_age` int(11) DEFAULT NULL COMMENT '工龄',
  PRIMARY KEY (`employee_id`),
  KEY `department_id_key` (`dept_id`),
  KEY `job_level_id_key` (`job_level_id`),
  KEY `post_id_key` (`post_id`),
  KEY `work_id_key` (`work_id`),
  CONSTRAINT `employee_ibfk_1` FOREIGN KEY (`dept_id`) REFERENCES `sys_dept` (`dept_id`),
  CONSTRAINT `employee_ibfk_2` FOREIGN KEY (`job_level_id`) REFERENCES `hr_job_level` (`job_level_id`),
  CONSTRAINT `employee_ibfk_3` FOREIGN KEY (`post_id`) REFERENCES `sys_post` (`post_id`)
) ENGINE=InnoDB AUTO_INCREMENT=732 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='员工表';

