/*Table structure for table `hr_employee_remove` */

DROP TABLE IF EXISTS `hr_employee_remove`;

CREATE TABLE `hr_employee_remove` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '员工调动编号',
  `employee_id` bigint(20) DEFAULT NULL COMMENT '员工编号',
  `before_dept_id` bigint(20) DEFAULT NULL COMMENT '调动前部门',
  `before_post_id` bigint(20) DEFAULT NULL COMMENT '调动前职位',
  `after_dept_id` bigint(20) DEFAULT NULL COMMENT '调动后部门',
  `after_post_id` bigint(20) DEFAULT NULL COMMENT '调动后职位',
  `remove_date` date DEFAULT NULL COMMENT '调动日期',
  `reason` varchar(255) DEFAULT NULL COMMENT '调动原因',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `pid` (`employee_id`),
  CONSTRAINT `employeeremove_ibfk_1` FOREIGN KEY (`employee_id`) REFERENCES `hr_employee` (`employee_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='员工调动表';

