/*Table structure for table `hr_leave` */

DROP TABLE IF EXISTS `hr_leave`;

CREATE TABLE `hr_leave` (
  `leave_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '请假编号',
  `employee_id` bigint(20) DEFAULT NULL COMMENT '员工编号',
  `days` int(11) DEFAULT NULL COMMENT '请假的天数',
  `type_num` int(11) DEFAULT NULL COMMENT '请假类型id',
  `start_date` date DEFAULT NULL COMMENT '请假的开始日期',
  `status` tinyint(4) DEFAULT '0' COMMENT '0未审核，1审核通过，2驳回，3撤销',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `is_deleted` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '状态/逻辑删除',
  PRIMARY KEY (`leave_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='员工请假表';

