/*Table structure for table `hr_overtime` */

DROP TABLE IF EXISTS `hr_overtime`;

CREATE TABLE `hr_overtime` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '加班编号',
  `salary_multiple` decimal(5,2) DEFAULT NULL COMMENT '工资倍数，如按照小时计算，就是员工平均小时工资乘以倍数',
  `bonus` decimal(10,3) DEFAULT NULL COMMENT '加班奖金',
  `overtime_type_id` int(11) DEFAULT NULL COMMENT '加班类型',
  `employee_id` bigint(20) DEFAULT NULL COMMENT '员工编号',
  `count_type` tinyint(4) DEFAULT NULL COMMENT '0小时，1天，默认0，计数加班工资的类型',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `is_time_off` tinyint(4) unsigned DEFAULT '0' COMMENT '0不补休，1补休，默认0',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `is_deleted` tinyint(3) DEFAULT '0',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='加班表';

